  2069â†’        // Animate numbers on load
  2070â†’        function animateNumber(element, start, end, duration) {
  2071â†’            const range = end - start;
  2072â†’            const increment = range / (duration / 16);
  2073â†’            let current = start;
  2074â†’
  2075â†’            const timer = setInterval(() => {
  2076â†’                current += increment;
  2077â†’                if ((increment > 0 && current >= end) || (increment < 0 && current <= end)) {
  2078â†’                    element.textContent = end.toLocaleString();
  2079â†’                    clearInterval(timer);
  2080â†’                } else {
  2081â†’                    element.textContent = Math.floor(current).toLocaleString();
  2082â†’                }
  2083â†’            }, 16);
  2084â†’        }
